			    for(var i=0;i<voters.length;i++){
			    	let v = voters[i];
			    	let h_id=v.fields.house;
			    	if(!v_houses[h_id]){
			    		v_houses[h_id]=[]
			    		v_houses[h_id].push(v)
			    	}else{
			    		v_houses[h_id].push(v)
			    	}
			    }

			var markers=[];

				function initMap() {
				var loaded_map = false;
				for(var i=0;i<houses.length;i++){
				  var p = houses[i];
				  
				  const position = { lat: parseFloat(p.fields.latitude), lng: parseFloat(p.fields.longitude) };
				  if(!loaded_map){
					  map = new google.maps.Map(document.getElementById("map"), {
					    center: position,
					    zoom: 16	
					  });

					  map.addListener('zoom_changed', function() {
					    
					    if (map.zoom >= 18) {
					    	for(var i=0;i<markers.length;i++){
					    		markers[i].icon.scaledSize = new google.maps.Size(32,32);
						      	markers[i].icon.size = new google.maps.Size(32, 32);
						      	markers[i].icon.labelOrigin = new google.maps.Point(15, 10);
						      	markers[i].setMap(map);
					    	}
					      
					    }

					    if (map.zoom <= 17) {
					    	for(var i=0;i<markers.length;i++){
					      //restore to original size upon specific zoom
					      markers[i].icon.scaledSize = new google.maps.Size(32, 32);
					      markers[i].icon.size = new google.maps.Size(32, 32);
					      markers[i].icon.labelOrigin = new google.maps.Point(15,10)
					      markers[i].setMap(map);
					    	}

					    }
					  });
					  loaded_map = true;
					}
				  // The marker, positioned at Uluru
				  const marker = new google.maps.Marker({
				    position: position,
				    map: map,
				    label: {
				    	text: ""+(i+1),
				    	fontSize: "0.8em",
				    },

					icon: {
				      url: "http://maps.google.com/mapfiles/kml/paddle/red-blank.png",
				      labelOrigin: new google.maps.Point(35,20)
				  	}
				  });

				  markers.push(marker)
				  let voter_str = "";
				  if(v_houses[p.pk]){
				  	for(var j=0;j<v_houses[p.pk].length;j++){
				  		voter_str+=v_houses[p.pk][j].fields.first_name + " " + v_houses[p.pk][j].fields.last_name + " ("+v_houses[p.pk][j].fields.party.substring(0,1)+")<br/>";
				  	}
				  }
				  const infowindow = new google.maps.InfoWindow({
				    content: "<div style='font-size:1.8em;'><strong>H#"+(i+1)+":</strong><br/>" +p.fields.address +"<br/><br/>"+voter_str+"</div>",
				  });
				  marker.addListener("click", () => {
				  	if(info_w!=null){
				  		info_w.close();
				  	}
				    infowindow.open({
				      anchor: marker,
				      map,
				      shouldFocus: false,
				    });
				    info_w = infowindow
				  });
				}
			}
		</script>

    <script

      async
    ></script>
